import React from 'react';
import './App.css';
import { Home, CreateWodRoute } from './routes';
import {
  BrowserRouter,
  Switch,
  Route
} from "react-router-dom";
import { NotFound,Dashboard } from './components';
function App() {
    return (
      <div>
        <BrowserRouter>
        {/* BrowserRouter doit avoir uniquement un enfant direct */}
        <div>
          <Switch>
          <Route path="/">
            <Home />
          </Route>
          <Route path="/CreateWodRoute">
            <CreateWodRoute />
          </Route>
          <Route>
            <Home />
          </Route>
          </Switch>

        </div>

        </BrowserRouter>
      </div>
    );
}

export default App;
